    <body>
        <div id="app"></div>
        <script>
            (function () {
                if (!Array.isArray(window.__studioCmdQueue__)) {
                    window.__studioCmdQueue__ = [];
                }
                if (typeof window.handleStudioCmd !== 'function') {
                    window.handleStudioCmd = function (jsonData) {
                        window.__studioCmdQueue__.push(jsonData);
                    };
                }
            })();
        </script>
